HTML (index.html):
```html
<!DOCTYPE html>
<html>
<head>
    <title>Todo App</title>
    <link rel="stylesheet" type="text/css" href="styles.css">
</head>
<body>
    <div id="todo-app">
        <input type="text" id="todo-input" placeholder="Unesi zadatak...">
        <button id="add-btn">Dodaj</button>
        <ul id="todo-list"></ul>
    </div>
    <script src="script.js"></script>
</body>
</html>
```

CSS (styles.css):
```css
body {
    font-family: Arial, sans-serif;
}

#todo-app {
    width: 300px;
    margin: 0 auto;
}

#todo-input {
    width: 200px;
    padding: 10px;
}

#add-btn {
    padding: 10px;
}

#todo-list {
    list-style-type: none;
    padding: 0;
}

.todo-item {
    margin: 10px 0;
    padding: 10px;
    border: 1px solid #ddd;
}
```

JavaScript (script.js):
```javascript
document.getElementById('add-btn').addEventListener('click', function() {
    var value = document.getElementById('todo-input').value;
    if (value) {
        addItem(value);
        document.getElementById('todo-input').value = '';
    }
});

function addItem(text) {
    var list = document.getElementById('todo-list');

    var item = document.createElement('li');
    item.innerText = text;
    item.classList.add('todo-item');

    list.appendChild(item);
}
```

Ovaj osnovni okvir omogućuje vam dodavanje stavki na "todo" listu. Unesite tekst u polje za unos i kliknite na "Dodaj" da biste dodali novu stavku.

